#   (c) or require extra processing outside the scope of a baseline model

df3 = df3.drop([
    'UserID',
    'FirstName',
    'LastName',
    'Street',
    'LicensePlate',
    'City',
    'DateOfBirth'
], axis=1)

# Step 3: Define input features (X) and the target variable (y)
X = df3.drop('BadCredit', axis=1)  # Features
y = df3['BadCredit']               # Target label (0 = good risk, 1 = bad risk)

# Step 4: Identify categorical and numerical features
# Categorical = text or category-like columns (e.g., 'Sex', 'Purpose')
# Numerical = numbers we can directly use in the model
categorical_cols = X.select_dtypes(include='object').columns
numerical_cols = X.select_dtypes(include=['int64', 'float64']).columns

# Step 5: Define preprocessing for categorical columns
# - Fill missing values with the most frequent value (mode)
# - Convert text to numeric using one-hot encoding
categorical_transformer = Pipeline(steps=[
    ('imputer', SimpleImputer(strategy='most_frequent')),
    ('encoder', OneHotEncoder(handle_unknown='ignore'))
])

# Step 6: Define preprocessing for numerical columns
# - Fill missing values with the mean of the column
numerical_transformer = Pipeline(steps=[
    ('imputer', SimpleImputer(strategy='mean'))
])

# Step 7: Combine both preprocessing steps
# This applies the right transformation to each column type
preprocessor = ColumnTransformer(transformers=[
    ('num', numerical_transformer, numerical_cols),
    ('cat', categorical_transformer, categorical_cols)
])

# Step 8: Build the ML pipeline
# - First preprocess the data
# - Then train a RandomForestClassifier with default settings
clf = Pipeline(steps=[
    ('preprocessor', preprocessor),
    ('classifier', RandomForestClassifier(random_state=42))
])

# Step 9: Use F1 score as evaluation metric
