#Feature Engineering Attempt # 2
# (1) AGE — how old is the applicant?
# Reason: Age is often related to financial stability.
# Older applicants may have more consistent credit history and fewer defaults.
# We'll calculate age by subtracting year of birth from the current year (2025).
df3 = pd.read_csv("https://drive.google.com/uc?export=download&id=1wOhyCnvGeY4jplxI8lZ-bbYN3zLtickf")
#df3.info()

if 'DateOfBirth' in df3.columns:
    df3['DateOfBirth'] = pd.to_datetime(df3['DateOfBirth'], errors='coerce')
    df3['Age'] = 2025 - df3['DateOfBirth'].dt.year
else:
    raise ValueError("The column 'DateOfBirth' is missing from the dataset.")

# (2) LoanToDurationRatio — how 'heavy' is the loan per unit of time?
# Reason: A large loan taken over a short time is riskier.
# This feature gives us a sense of financial burden on the applicant.
df3['LoanToDurationRatio'] = df3['Amount'] / (df3['Duration'] + 1)

# (3) AgeGroup — bucket age into 3 categories (young, mid, older)
# Reason: Instead of using raw age, we group it.
# This helps the model generalize better, and handle outliers (very young/old cases).
# We’ll do this in the pipeline using KBinsDiscretizer (quantile-based bucketing).

# Step 3: Drop unhelpful columns
# These are personal identifiers (e.g., name, address) that:
# - don't help with predictions,
# - add noise,
# - or would cause overfitting if kept.
df3 = df3.drop(['UserID', 'FirstName', 'LastName', 'Street', 'LicensePlate', 'City', 'DateOfBirth'], axis=1)

# Step 4: Define features (X) and target (y)
X = df3.drop('BadCredit', axis=1)
y = df3['BadCredit']

# Step 5: Identify column types for preprocessing
categorical_cols = X.select_dtypes(include='object').columns.tolist()
numerical_cols = X.select_dtypes(include=['int64', 'float64']).columns.tolist()

# We will bucket Age using a special transformer, so remove it from normal numeric list
if 'Age' in numerical_cols:
    numerical_cols.remove('Age')

# ----------------------------------------------------------
# Step 6: Build preprocessing pipelines for each column type
# ----------------------------------------------------------

# Categorical columns → fill missing with most common, then one-hot encode
categorical_transformer = Pipeline(steps=[
    ('imputer', SimpleImputer(strategy='most_frequent')),
    ('encoder', OneHotEncoder(handle_unknown='ignore'))
])

# Numerical columns → fill missing with the average value
numerical_transformer = Pipeline(steps=[
    ('imputer', SimpleImputer(strategy='mean'))
])

# Age binning → divide ages into 3 groups (young/middle/old)
age_discretizer = Pipeline(steps=[
    ('imputer', SimpleImputer(strategy='mean')),
    ('discretizer', KBinsDiscretizer(n_bins=3, encode='onehot-dense', strategy='quantile'))
])

# Combine all preprocessing into a single transformer
preprocessor = ColumnTransformer(transformers=[
    ('num', numerical_transformer, numerical_cols),    # e.g. Amount, Duration, LoanToDurationRatio
    ('cat', categorical_transformer, categorical_cols),# e.g. Sex, Purpose, Married
    ('agebin', age_discretizer, ['Age'])               # Binned Age
])

# Step 7: Build a pipeline with preprocessing + model
# We're using RandomForestClassifier with default settings (no tuning)
clf = Pipeline(steps=[
    ('preprocessor', preprocessor),
    ('classifier', RandomForestClassifier(random_state=42))
])

# Step 8: Evaluate model performance using 10-fold cross-validation
# F1 score balances precision (how many predicted bads were actually bad)
# and recall (how many actual bads we caught)
f1 = make_scorer(f1_score)
cv_scores = cross_val_score(clf, X, y, cv=10, scoring=f1)

# Step 9: Output the final average F1 score
print(f"Mean F1 Score (With Improved Feature Engineering): {cv_scores.mean():.4f}")

