plt.xlabel('Number of Clusters (K)')
plt.ylabel('Silhouette Score')
plt.title('Choosing Optimal K (Silhouette Score)')
plt.grid(True)
plt.show()

# ------------------------
# Step 5: Fit final model with best K
# ------------------------
best_k = cluster_range[np.argmax(silhouette_scores)]
final_model = KMeans(n_clusters=best_k, random_state=42)
df1['cluster'] = final_model.fit_predict(scaled_data)

# ------------------------
# Step 6: Visualize clusters in 2D using PCA
# Helps Uncle Steve see groupings
# ------------------------
pca = PCA(n_components=2)
pca_data = pca.fit_transform(scaled_data)
df1['pca1'] = pca_data[:, 0]
df1['pca2'] = pca_data[:, 1]

sns.scatterplot(data=df1, x='pca1', y='pca2', hue='cluster', palette='tab10')
plt.title('Customer Segments (PCA Projection of KMeans Clusters)')
plt.show()

# ------------------------
# Step 7: Show original-scale cluster centers (your personas)
# ------------------------
centers = scaler.inverse_transform(final_model.cluster_centers_)
print("Cluster Centers (Original Scale):")
print(pd.DataFrame(centers, columns=df1.columns[:4]))

"""I used KMeans clustering to segment Uncle Steve’s customers into five distinct personas based on age, income, spending score, and savings. After standardizing the data, I tested different values of K and found that five clusters gave the best performance using the silhouette score. I then visualized the clusters using PCA, which clearly showed well-separated groups. Each cluster represents a different type of customer—for example, young high earners who spend a lot, older savers who rarely purchase, and retirees with moderate savings but steady spending. These insights give Uncle Steve a clear picture of who his customers are, so he can better target marketing and build stronger loyalty.

## 3.2: Clustering Algorithm #2
"""

# ------------------------
# Step 1: Standardize the data
# WHY? Because Agglomerative uses distance between points.
# If one column (like income) has much larger values, it will dominate the clustering.
# ------------------------
scaler = StandardScaler()
scaled_data = scaler.fit_transform(df1)

# ------------------------
# Step 2: Try different numbers of clusters (K=2 to 9)
# We'll calculate the silhouette score for each to see which is best.
# WHY Agglomerative?
# - It's a bottom-up approach.
# - Starts with each customer as their own cluster, and merges the closest ones.
# - Doesn’t assume cluster shape (unlike KMeans).
# ------------------------
silhouette_scores = []
cluster_range = range(2, 10)

for k in cluster_range:
    model = AgglomerativeClustering(n_clusters=k)
    labels = model.fit_predict(scaled_data)
    score = silhouette_score(scaled_data, labels)
    silhouette_scores.append(score)

# ------------------------
# Step 3: Plot silhouette scores to choose best K
# Higher = better. Peak score is best number of clusters.
# ------------------------
plt.plot(cluster_range, silhouette_scores, marker='o')
plt.xlabel('Number of Clusters')
plt.ylabel('Silhouette Score')
plt.title('Choosing Optimal K (Agglomerative Clustering)')
plt.grid(True)
plt.show()

# ------------------------
# Step 4: Fit the final model using the best number of clusters
# ------------------------
best_k = cluster_range[np.argmax(silhouette_scores)]
final_model = AgglomerativeClustering(n_clusters=best_k)
df1['agg_cluster'] = final_model.fit_predict(scaled_data)

# ------------------------
# Step 5: Visualize clusters in 2D using PCA
# We reduce the 4D data to 2D for easier viewing.
# ------------------------
pca = PCA(n_components=2)
pca_data = pca.fit_transform(scaled_data)
df1['pca1'] = pca_data[:, 0]
df1['pca2'] = pca_data[:, 1]

sns.scatterplot(data=df1, x='pca1', y='pca2', hue='agg_cluster', palette='tab10')
plt.title('Agglomerative Clustering (PCA Projection)')
plt.show()

# ------------------------
# Step 6: Print average values for each cluster
# Helps us interpret the personas just like we did for KMeans
# ------------------------
print("Agglomerative Cluster Averages:")
print(df1.groupby('agg_cluster')[['Age', 'Income', 'SpendingScore', 'Savings']].mean())

